/* Cambia el color del texto seleccionado */
::selection {
    background: rgb(240, 255, 255); /* Color de fondo del texto seleccionado */
    color: inherit; /* Mantiene el color original del texto */
}

::-moz-selection {
    background: rgb(240, 255, 255); /* Color de fondo del texto seleccionado para Firefox */
    color: inherit; /* Mantiene el color original del texto */
}
